Patrząc na długość utworu to tak, chodzi o "Ogrodu serce" ale patrząc na płytę pt. "To co najlepsze z dziesięciu lat 1983 - 93" to chodzi o utwór "W moim ogrodzie". Ten utwór istniał, więc nie piernicz głupot tylko zapoznaj się lepiej z materiałem. Muzyka jest trochę zmieniona i zresztą inny jest wykonawca: "Ogrodu serce" śpiewa Strojnowski, a "W moim ogrodzie - Zeńczewski" (osobiście uważam, że Strojnowski lepiej ;) i w ogóle ta pierwotna wersja z pierwszej płyty lepsza)
